from typing import List

class Solution:
    def maximumTripletValue(self, nums: List[int]) -> int:
        max1 = max2 = float('-inf')
        min1 = float('inf')
        for num in nums:
            if num > max1:
                max2 = max1
                max1 = num
            elif num > max2:
                max2 = num
            if num < min1:
                min1 = num
        max_product = float('-inf')
        for i in range(1, len(nums) - 1):
            if nums[i] == min1:
                continue
            max_product = max(max_product, (max1 - nums[i]) * max2, (nums[i] - min1) * max1)
        return max(max_product, 0)
